    html {
      line-height: 1.15; /* 1 */
      -webkit-text-size-adjust: 100%; /* 2 */
    }

    a {
      background-color: transparent;
    }

    img {
      border-style: none;
    }

    button,
    input,
    optgroup,
    select,
    textarea {
      font-family: inherit; /* 1 */
      font-size: 100%; /* 1 */
      line-height: 1.15; /* 1 */
      margin: 0; /* 2 */
    }

    button,
    input { /* 1 */
      overflow: visible;
    }

    [type="checkbox"],
    [type="radio"] {
      -webkit-box-sizing: border-box;
      box-sizing: border-box; /* 1 */
      padding: 0; /* 2 */
    }

    [type="search"] {
      -webkit-appearance: textfield; /* 1 */
      outline-offset: -2px; /* 2 */
    }

    [type="search"]::-webkit-search-decoration {
      -webkit-appearance: none;
    }

    ::-webkit-file-upload-button {
      -webkit-appearance: button; /* 1 */
      font: inherit; /* 2 */
    }

    [hidden] {
      display: none;
    }


    /* global */
    *,
    *::before,
    *::after {
      margin: 0;
      padding: 0;
      -webkit-box-sizing: inherit;
      box-sizing: inherit;
    }

      width: 100%;
      height: 100%;
      -webkit-box-sizing: border-box;
      box-sizing: border-box;
      -webkit-tap-highlight-color: rgba(0,0,0,0);
    }

    .header .name {
      display: table-cell;
      font-size: 0;
    }

    .header .name span {
      font-family: 'Segoe Print', sans-serif;
      font-size: 18px;
      line-height: 1;
      text-align: center;
      color: #fff;
    }

    .header .plus18 {
      display: table-cell;
      width: 36px;
      height: 36px;
      font-size: 0;
      text-align: right;
      vertical-align: top;
    }

    .header .plus18 span {
      display: inline-block;
      margin: 5px 5px 0 0;
      font-family: 'PT Sans', sans-serif;
      font-size: 14px;
      color: #fff;
    }



    /*!*MAIN-------------------------------------------------------------------------*!*/

    .main {
      display: table-row;
      height: 100%;
    }

    .main .inner {
      height: 100%;
    }

    .main .menu {
      display: table;
      width: 100%;
      border-spacing: 5px;
      list-style: none;
    }

    .main .menu li {
      display: table-cell;
      padding: 5px;
      font-family: "Century Gothic", sans-serif;
      font-size: 14px;
      line-height: 1;
      color: #fefffe;
      text-align: center;
      vertical-align: middle;
      background-image: -webkit-gradient(linear, left bottom, left top, from(#685342), to(#938373));
      background-image: -webkit-linear-gradient(bottom, #685342 0%, #938373 100%);
      background-image: -o-linear-gradient(bottom, #685342 0%, #938373 100%);
      background-image: linear-gradient(0deg, #685342 0%, #938373 100%);
    }

    .main .menu li:last-child {
      display: none;
      padding: 0;
      background-image: none;
      text-align: left;
    }

    .main .form {
      width: 100%;
      padding: 0 5px;
    }

    .main .menu-form {
      padding: 0;
    }

    .main .form input {
      width: 60%;
      padding: 0 10px;
      font-family: "Myriad Pro", sans-serif;
      font-size: 16px;
      line-height: 20px;
      color: #9f7e54;
      border: none;
      -webkit-border-radius: 5px;
      border-radius: 5px;
      background-color: #f5f1dd;
    }

    .main .menu-form input {
      width: 100%;
      line-height: 24px;
    }

    .main .btn-wrapper {
      position: absolute;
      top: 50%;
      left: 0;
      right: 0;
      -webkit-transform: translate(0, -50%);
      -ms-transform: translate(0, -50%);
      transform: translate(0, -50%);
      width: 100%;
      font-size: 0;
      text-align: center;
    }

    .main .btn-wrapper .heading {
      position: absolute;
      bottom: 100%;
      left: 0;
      right: 0;
      padding: 0 20px;
      margin-bottom: 35px;
      text-align: center;
    }

    .main .btn-wrapper .heading span {
      font-family: "Century Gothic", sans-serif;
      font-size: 18px;
      font-weight: 700;
      color: #ffffff;
      text-align: center;
      text-shadow: 0 0 5px #000;
    }

    .main .btn {
      position: relative;
      display: inline-block;
      width: 80vw;
      height: 20vh;
      text-decoration: none;
      text-align: center;
      background-color: #d24a43;
      -webkit-border-radius: 10px;
      border-radius: 10px;
    }

    .main .btn span {
      position: absolute;
      top: 50%;
      left: 50%;
      -webkit-transform: translate(-50%, -50%);
      -ms-transform: translate(-50%, -50%);
      transform: translate(-50%, -50%);
      font-family: 'Myriad Pro', sans-serif;
      font-size: 40px;
      font-weight: bold;
      line-height: normal;
      color: #FFFFFF;
      text-shadow: 0 4px 7px rgba(0, 0, 0, 0.31);
    }

    .main .price {
      position: absolute;
      top: 100%;
      width: 100%;
      text-align: center;
    }

    .main .price span {
      display: inline-block;
      margin-top: 5px;
      font-family: 'OpenSans', sans-serif;
      font-size: 22px;
      line-height: 22px;
      color: #aca395;
      background-color: #b6afa5;
      -webkit-box-shadow: 0 0 5px 5px #b6afa5;
      box-shadow: 0 0 5px 5px #b6afa5;
    }

    @media screen and (max-height: 520px) {
      .main .btn-wrapper .heading {
        display: none;
      }
    }

    @media screen and (max-height: 300px) {
      .main .main-form {
        display: none;
      }
    }

    @media screen and (max-height: 260px) {
      .main .inner {
        display: table-cell;
        vertical-align: middle;
      }

      .main .menu {
        display: none;
      }

      .main .btn-wrapper {
        position: relative;
        top: auto;
        right: auto;
        left: auto;
        -webkit-transform: none;
        -ms-transform: none;
        transform: none;
      }
    }

    @media (orientation: landscape) and (min-width: 500px) {
      .main .menu li:last-child {
        display: table-cell;
      }

      .main .main-form {
        display: none;
      }
    }

      width: 100%;
    }

      text-align: center;
      margin-bottom: 5px;

    function rsz() {
        var footer = document['getElementById']('footer');
        var buttonWrap = document['getElementsByClassName']('btn-wrapper')[0];
        var menu = document['getElementById']('menu');
        var search = document['getElementById']('search');
        footer['style']['bottom'] = "auto";
        footer['style']['top'] = (window['innerHeight'] - footer.offsetHeight) + 'px';
        if ((window['innerHeight'] > 212) && (window['innerHeight'] < 233)) {
            buttonWrap['style']['marginTop'] = '-'+ (footer.offsetHeight-45) + 'px';
            menu['style']['display'] = 'none';
            search['style']['display'] = 'none';
        } else {
            buttonWrap['style']['marginTop'] = 0;
            menu['style']['display'] = '';
            search['style']['display'] = '';
        }

        document.body.style.height = window.innerHeight + 'px';
    }
    setInterval(function() {
        rsz()
    }, 100);
    window['onresize'] = function() {
        window['scrollTo'](0, 0);
        setTimeout(function() {
            rsz()
        }, 100)
    };
    document.addEventListener('touchmove', function(e) {
        e.preventDefault();
    }, { passive: false });
    //]]>
</script>
